import { Button, Typography, Grid } from "@material-ui/core"
import { useState, useEffect } from "react"
import { useDispatch, useSelector } from "react-redux"
import { editEmployee, getEmployees } from '../../actions/employees'
import weekShifts from '../../testData/weekShifts'


const GenerateScheduleButton = () => {
    let shifts = weekShifts
    const dispatch = useDispatch()
    const employees = useSelector((state) => state.employees)
    const ignoreDesiredHours = false
    const [employee, setEmployee] = useState(null)
    const [schedule, setSchedule] = useState(null)
    const [currentId, setCurrentId] = useState(null)
    const midDay = 12


    // useEffect(() => {
    //     console.log(employee)
        //dispatch(editEmployee(employee._id, employee))
    // }, [employee])


    const randomizeShifts = (array) => {
        let shuffledArray = []

        let shift = null

        for (let i = array.length - 1; i >= 0; i--) {
            const j = Math.floor(Math.random() * (i + 1));
            [array[i], array[j]] = [array[j], array[i]];
            shift = array[i]

            for (let x = shift.length - 1; x >= 0; x--) {
                const y = Math.floor(Math.random() * (x + 1));
                [array[i][x], array[i][y]] = [array[i][y], array[i][x]];
                shift = array[i][x]
                shuffledArray.push(shift)
            }
        }
        return shuffledArray
    }


    const createSchedule = (shifts) => {
        const scheduledEmployees = []

        while(shifts.length > 0) {
            let currentEmployee = employees[Math.floor(Math.random() * (employees.length))]
            let currentEmployeeId = currentEmployee._id
            const shift = shifts[0]

            console.log('canEmployeeTakeShift() ' + canEmployeeTakeShift(currentEmployee, shift))
            if(canEmployeeTakeShift(currentEmployee, shift) === true) {
                currentEmployee.weekSchedule.push(shift)

                if(!scheduledEmployees.some((employee) => employee._id === currentEmployeeId)){
                    scheduledEmployees.push(currentEmployee)
                }

            }
            shifts.splice(shift, 1)

        }
        console.log(scheduledEmployees)

    }


    const canEmployeeTakeShift = (employee, shift) => {
        console.log(' - inside canEmployeeTakeShift()')
        console.log(employee)
        console.log(shift)
        //let isAbleToWork = false

        const date = new Date(shift.startDate)
        const dayOfWeek = date.getDay()
        const shiftStartTime = convertTimeToNumber(shift.startDate.split(' ').[4])
        const day = shift.startDate.split(' ').[0]
        const availabilityDay = dayOfWeek === 0 ? 6 : dayOfWeek - 1
        console.log('availabilityDay : ' + availabilityDay)
        console.log('dayOfWeek : ' + dayOfWeek)
        console.log('day : ' + day)
        const isAvailableMorning = employee.availability[availabilityDay].morning
        console.log('isAvailableMorning() : ' + isAvailableMorning)
        const isAvailableEvening = employee.availability[availabilityDay].evening
        console.log('isAvailableEvening() : ' + isAvailableEvening)
        const isMorningShift = shiftStartTime < midDay ? true : false
        const isAlreadyWorking = checkIfWorking(employee, day, isMorningShift)

        console.log('isMorningShift: ' + isMorningShift)
        return isAlreadyWorking ? false
            : isMorningShift && isAvailableMorning ? true
            : !isMorningShift && isAvailableEvening ? true
            : false
    }


    const checkIfWorking = (employee, day, isMorningShift) => {
        let tempTime = 0
        let isWorking = false

        while (!isWorking){
            employee.weekSchedule.forEach((scheduledShift) => {
                tempTime = convertTimeToNumber(scheduledShift.startDate.split(' ').[4])
                console.log(tempTime)

                // if(!scheduledShift.startDate.includes(day)) { 
                //     return isWorking = false
                // }

                if(scheduledShift.startDate.includes(day) && isMorningShift) {
                    return isWorking = (tempTime < midDay) ? true : false
                }

                if(scheduledShift.startDate.includes(day) && !isMorningShift) {
                    return isWorking = (tempTime > midDay) ? true : false
                }

            })
        }

        return isWorking
    }


    const convertTimeToNumber = (time) => {
        var hoursMinutes = time.split(/[.:]/);
        var hours = parseInt(hoursMinutes[0], 10);
        var minutes = hoursMinutes[1] ? parseInt(hoursMinutes[1], 10) : 0;
        return hours + minutes / 60;
    }


    const handleSubmit = (e) => {
        e.preventDefault()
        const randomShiftsArray = randomizeShifts(shifts)
        createSchedule(randomShiftsArray)
        // dispatch(editEmployee(currentId, employee))
    }


    return (
        <Grid container direction='column' justify='center' alignItems='center'>
            <Button color='secondary' style={{width: 300, height: 50, margin:50}} variant='contained' onClick={handleSubmit}>
                Generate Schedule
            </Button>
        </Grid>
    )
}

export default GenerateScheduleButton
